import "./style.css";

function App() {
  return (
    <header className="header">
      <div className="logo">
        <img src="robot.png" height="80" width="80" alt="Learn With Me Robot" />
        <h1>Learn with me</h1>
      </div>

      <button
        className="btn btn-large btn-open"
        style="background-color: rgb(234, 219, 200)"
      >
        Share a fact
      </button>
    </header>
  );
}

export default App;
